import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      feed: [
        { id: 1, username: "Arthur", curtidas: 10, comentarios: 2 },
        { id: 2, username: "Sol", curtidas: 20, comentarios: 20 },
        { id: 3, username: "Nathan", curtidas: 5, comentarios: 13 },
      ],
    };
  }

  render() {
    return (
      <div>
        {this.state.feed.map((item) => {
          return (
            <div key={item.id}>
              <h3>{item.username}</h3>
              <a>
                Curtidas: {item.curtidas} - Comentários {item.comentarios}
              </a>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
